import React from 'react';
import { Link } from 'react-router-dom';

function Contact() {
  return (
    <>
      <div className="featured-contact">
        <Link to="/">Online Giving</Link>
        <Link to="/">Contact Us</Link>
      </div>
    </>
  )
}

export default Contact
